			* {
				font-family: "pretendard", sans-serif, Arial;
				overflow: hidden;
			}

			.widget-point {
				border-radius: 8px;
				background-color: #fff;
				width: 100%;
				max-width: max-content;
				min-width: 400px;
				height: 500px;
				margin: auto;
				padding: 16px 20px 8px;
				box-shadow: 3px 3px 3px 3px rgb(233, 233, 233);
				font-size: 12px;
			}

			.point-header {
				height: 100px;
			}

			.font-14 {
				font-size: 14px;
				font-weight: bold;
			}

			.button {
				all: unset;
				cursor: pointer;
				float: right;
			}

			.contents-wrapper {
				margin: 20px 0;
				font-weight: bold;
			}

			.user-contents {
				text-align: center;
				line-height: 2;
				background-color: #f8f9fc;
				border-radius: 5px;
				left: 20px;
				right: 20px;
				width: 48%;
				float: left;
				padding: 8px 0;
			}

			.rank-wrapper {
				margin-top: 20px;
			}

			.rank-table {
				margin-bottom: 20px;
				overflow-y: scroll;
				-ms-overflow-style: none;
				scrollbar-width: none;
				height: 356px;
			}

			.rank-table::-webkit-scrollbar {
				display: none;
			}

			.rank-table-row {
				display: flex;
				align-items: center;
				width: 100%;
			}

			.rank-table-cell {
				vertical-align: middle;
				text-align: center;
				padding: 0 3px;
				border-style: none none double none;
				border-color: #ededed;
			}

			.cell-5 {
				width: 5%;
				margin-bottom: 4px;
			}
			.cell-40 {
				width: 47%;
			}

			.rank-1 {
				background-color: #ffd91d;
				border-radius: 50%;
				width: 18px;
				height: 18px;
			}

			.rank-2 {
				background-color: #e3e3e3;
				border-radius: 50%;
				width: 18px;
				height: 18px;
			}

			.rank-3 {
				background-color: #e1c8a5;
				border-radius: 50%;
				width: 18px;
				height: 18px;
			}

			.rank-etc {
				background-color: #e3f5f9;
				border-radius: 50%;
				width: 18px;
				height: 18px;
			}

			.score {
				font-weight: 500;
			}

			#anim {
				position: absolute;
				width: 100%;
				top: 30%;
				left: 0%;
			}
		</style>
	</head>

		<script type="text/javascript">
			function closeScoreWidget() {
				window.parent.postMessage(
					{
						type: "rankClose",
					},
					"*"
				);
			}

			function removeNode() {
				let header = document.querySelector(".rank-table");

				while (header.hasChildNodes()) header.removeChild(header.firstChild);
			}

			function getRankClass(r) {
				switch (r) {
					case 1:
						return "rank-1";
						break;
					case 2:
						return "rank-2";
						break;
					case 3:
						return "rank-3";
						break;
					default:
						return "rank-etc";
						break;
				}
			}

			function createNode(item, rank) {
				let header = document.querySelector(".rank-table");
				let rowDiv = document.createElement("div");
				rowDiv.setAttribute("class", "rank-table-row");
				let rankCellDiv = document.createElement("div");
				rankCellDiv.setAttribute("class", "rank-table-cell cell-5");
				let rankItem = document.createElement("p");
				rankItem.setAttribute("class", getRankClass(rank));
				rankItem.innerHTML = rank;
				let nameCellDiv = document.createElement("div");
				nameCellDiv.setAttribute("class", "rank-table-cell cell-40");
				let nameItem = document.createElement("p");
				nameItem.setAttribute("class", "rank" + rank + "name");
				nameItem.innerHTML = item[0];
				let scoreCellDiv = document.createElement("div");
				scoreCellDiv.setAttribute("class", "rank-table-cell cell-40");
				let scoreItem = document.createElement("p");
				scoreItem.setAttribute("class", "rank" + rank + "score");
				if (item[1] == 0) {
					scoreItem.innerHTML = ", : " + item[2];
				} else {
					scoreItem.innerHTML = item[1] + " ";
				}

				rankCellDiv.append(rankItem);
				rowDiv.append(rankCellDiv);
				nameCellDiv.append(nameItem);
				rowDiv.append(nameCellDiv);
				scoreCellDiv.append(scoreItem);
				rowDiv.append(scoreCellDiv);
				header.append(rowDiv);
			}

			window.addEventListener("message", function (e) {
				let str = "";
				removeNode();
				for (let i = 0; i < e.data.allrank.length; ++i) {
					console.log(e.data.allrank[i][0]);
					createNode(e.data.allrank[i], i + 1);
					// str = 'rank' + (i+1) + 'name';
					// document.getElementById(str).innerHTML = e.data.allrank[i][1].name;
					// str = 'rank' + (i+1) + 'score';
					// document.getElementById(str).innerHTML = e.data.allrank[i][1].score;
				}
			});
		</script>
	</body>
